import React from 'react';

const ContactInfo = () => {
  // Array de objetos que contiene los datos de contacto
  const contactDetails = [
    { label: 'Dirección', value: 'PASCO 1038 – 2152 – GRANADERO BAIGORRIA' },
    { label: 'Teléfono', value: '+54 341468874' },
    { label: 'Correo Electrónico', value: 'administracion@ultracor.com.ar' }
  ];

  return (
    <div>
      <h3>Datos de Contacto</h3>
      <ul>
        {contactDetails.map((item, index) => (
          <li key={index}>
            <strong>{item.label}:</strong> {item.value}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ContactInfo;
